import React, { Component } from 'react'
import {Container} from 'react-bootstrap';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Assg = (e) => {
    const { no , prob_name} = e;
    let a = e.no ? e.no : 69;
    let b = prob_name === "" ? prob_name : "Placeholder Question Title";
    return (
      <Container
        style={{
          marginLeft: "10px",

          boxShadow: "-1px 0px 2px #000000",
          paddingLeft: "0px",
          width: "65%",
          paddingRight: "0px",
          marginTop: "5px",
          display: "flex",
          flexDirection: "horizontal",
          backgroundColor: "#ffffff"
        }}
      >
        <div
          style={{
            padding: "10px",
            height: "120px",

            marginLeft: "0px"
          }}
        >
          <h2
            style={{
              padding: "5px",

              borderBottom: "2px solid #dee0df"
            }}
          >
            Assignment {a}{" "}
          </h2>
          <h5>{b}</h5>
        </div>

        <div
          style={{
            backgroundColor: "#ffffff"
          }}
        >
          <FontAwesomeIcon icon={faCoffee} />
        </div>
      </Container>
    );
}

export default Assg;
